window.bookSummaryJSON = "<p><b>Your road map to a seven-figure business...in one year or less</b></p> <p>By cutting out the noise and providing a clear and proven plan, this road map helps even brand-new entrepreneurs make decisions quickly, get their product up for sale, and launch it to a crowd that is ready and waiting to buy.</p> <p>This one-year plan will guide you through the three stages to your first $1 million:</p> <p>The Grind (Months 0-4): This step-by-step plan will help you identify a winning product idea, target customers that are guaranteed to buy, secure funding, and take your first sale within your first four months.</p> <p>The Growth (Months 5-8): Once you're in business, you will discover how to use cheap and effective advertising strategies to get your product to at least 25 sales per day, so you can prove you have a profitable business.</p> <p>The Gold (Months 9-12): It's time to establish series of products available for sale, until you are averaging at least 100 sales per day, getting you closer to the million-dollar mark every single day.</p> <p>Through his training sessions at Capitalism.com, Ryan Daniel Moran has helped new and experienced entrepreneurs launch scalable and sustainable online businesses. He's seen more than 100 entrepreneurs cross the seven-figure barrier, many of whom go on to sell their businesses.</p> <p>If your goal is to be a full-time entrepreneur, get ready for one chaotic, stressful, and rewarding year. If you have the guts to complete it, you will be the proud owner of a million-dollar business and be in a position to call your own shots for life.</p>"; 
